import React, { Component } from "react";
import { BrowserRouter, Routes, Route} from "react-router-dom";
import Productos from "./Componentes/Productos";
import Clientes from "./Componentes/Clientes";
import Ventas from "./Componentes/Ventas";
import Consolidacion from "./Componentes/Consolidacion";
import GuardarClientes from "./Componentes/GuardarClientes";
import Reportes from "./Componentes/Reportes";
import SubirProducto from "./Componentes/SubirProducto";
import Inicio from "./Componentes/inicio";

class Rutas extends Component {
    render() {
        return (
            <BrowserRouter>
                <Routes>
                    <Route path="/productos" element={<Productos />} />
                    <Route path="/clientes" element={<Clientes />} />
                    <Route path="/consolidacion" element={<Consolidacion />} />
                    <Route path="/guardarclientes" element={<GuardarClientes />} />
                    <Route path="/reportes" element={<Reportes />} />
                    <Route path="/ventas" element={<Ventas />} />
                    <Route path="/subirProductos" element={<SubirProducto />} />
                    <Route path="/inicio" element={<Inicio />} />
                </Routes>
            </BrowserRouter>
        );
    }
}
///:codigo para poder concatenar en una ruta del front, no del back
export default Rutas;
